We’re here! I am so excited to be in Chicago this week for the installation of the @housebeautiful Whole Home Show House! 

Our team will be designing 3 areas; Salon/Sitting Room, Hallway and a Bedroom! I was inspired by nature, femininity, and the architecture of the home! Here’s a sneak peek at the mood board and a few before images! Follow along with me on this journey with our hashtag #gshbwholehome 

