THE #1 NEW RELEASE IN DECORATIVE ARTS ON AMAZON… ICONIC HOME! 
Yesterday… left me speechless. From the unexpected opportunity to speak on a panel to a beautiful celebration and book signing! I was in awe…. I still am in awe! Thank you to everyone who attended the panel and the celebration, everyone who has purchased the book,  anyone who asked me to sign the book and those who shared their heart and kind words with me. I consider it a blessing that just being authentically me and sharing my heart and journey could impact even just one. I’m still searching for words to describe what happened yesterday… but wanted to pause, take it all in… and say THANK YOU!
@junereese__ you did it! #1!!!
